import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Card from "./components/Card";

export default function App() {
    const firstName = "Joe";
    const lastName = "Schmoe";
    return (
        <div>
            <Navbar />
            <Hero />
            <Card />
            <h1>Hello {firstName} {lastName}</h1>
        </div>
    )
}
